pragma solidity >=0.4.4 <0.7.0;

contract ValoresDeRetorno{

    // funcion que devuelva un saludo
    function Saludos() public pure returns (string memory){
        return "saludos";
    }

    // funcion que devuelva el resultado de una multiplicacion

    function Multiplicacion(uint _num1 , uint _num2) public pure returns (uint){
        return _num1*_num2;
    }

    
}
